[MoneyTalks] A Painter's Delite

Ariel Teens, Havoc Hailey, Tristan Taylor, Capri Cavanni

Beauty is art and Money Talks is beauty in motion. Everyone knows that there is nothing more beautiful than the female form.
First up in this exciting episode of Money Talks we pay tribute to our boys in the military, by convincing three lovely ladies to
each get body painted with the uniforms of the Army, Navy, and Marines. After that Havoc and the gorgeous Capri Cavalli, hit
the pavement on a mission to find a guy willing to lay flat on his back and let Capri grind her perfect vag all over his forehead
until she gets off. Lets just say we gave a new meaning to the term hair gel. For our main event the Money Talks gang decided
to put together a little art class, by setting up in a perfect art studio, and inviting a couple of nude models to pose for us.
The first two models were not exactly down for our shenanigans, but the third model turned out to be a real art connoisseur,
and not to mention a total freak. This is truly a memorable episode

